import React from 'react';
import './About.css'; 

const About = () => {
  return (
    <div className="about-container">
      <h1>About Us</h1>
      <div className="creators">
        <h2>Creators:</h2>
        <ul>
          <li>Sharon Gordon</li>
          <li>Rony Borsukovski</li>
        </ul>
      </div>
      <div className="description">
        <h2>About Us:</h2>
        <p>We are a team of passionate developers dedicated to creating the best shopping app experience. Our goal is to provide a seamless and efficient platform for users to manage their shopping needs.</p>
      </div>
    </div>
  );
};

export default About;
